import React, { Component } from "react";

class Info extends Component {
  render() {
    const { location, foodType, age, likes } = this.props.user;

    return (
      <React.Fragment>
        <h3 className="user-deets">
          <a href={this.props.user.twitterUsername}>{this.props.user.name}</a>
        </h3>
        <div className="user-deets">Location</div>
        <div className="user-deets">{location}</div>
        <div className="user-deets">Eats</div>
        <div className="user-deets">{foodType}</div>
        <div className="user-deets">Age</div>
        <div className="user-deets">{age}</div>
        <div className="user-deets">Likes</div>
        <div className="user-deets">{likes}</div>
        <div className="user-deets">Twitter</div>
        <div className="user-deets">
          <a href={this.props.user.twitterUsername}>
            @{this.props.user.twitterUsername}
          </a>
        </div>
      </React.Fragment>
    );
  }
}

export default Info;
